function drawChart(){$("#error").addClass("hide");$.get("/Home/GetChartData",{a:$("#a").val(),k:$("#k").val(),f:$("#f").val(),type:$("input[name=type]:checked").val()},function(n){var t,i;if(!n.isValid){$("#error").toggle();$("#error")[0].textContent="You entered wrong data. All values must be doubles";$("#error").removeClass("hide");return}t=n.x.slice();t.unshift("x");i=n.y.slice();i.unshift("dx/dt");c3.generate({bindto:"#chart",data:{x:"x",columns:[t,i]}})})}